  input: '"TEXT","F3XA","C00167320","Q1. The Committee has used the names and ASDC
    and Dollars for Democrats(D4D)  interchangeably as the original name of the project
    was ASDC Dollars for Democrats  We have changed the description on the unitemized
    receipt record to read ASDC/D4D to clarify this receipt and avoid further confusion.  Q2.  Please
    be advised that CT Victory 2004 and Connecticut Victory are indeed the same committee
    and are distinct from DNC-Victory Fund. A memo schedule A was included to itemize
    the Committees share of the DNC-Victory Fund program.  The Connecticut Victory
    2004 (i.e. Connecticut Victory) was a joint fundraising committee established
    with the DSCC (Democratic Senatorial Campaign Committee) for the 2004 election
    cycle. The Committee has amended the report and now will only use CT Victory 2004
    for clarity. The Committee did not receive from the DSCC the information with
    which to itemize the Committees share of the CT Victory 2004 program until April
    of 2005, and will therefore include a memo schedule A on the May 2005 monthly
    report.  Q3.  In review of the voter file/consulting/data/software issue you reference
    in your letter of April 27, 2005 and in consultation with our legal counsel, we
    have determined that these activities do not meet the definition of Federal Election
    Activity as these expenditures were for costs incurred in the building of our
    voter file. Q4. The FEA Paid Phones disclosed on line 21(b) did not promote, support,
    attack or oppose any candidate for federal office; the purpose of these phone
    calls were voter identification activity that referenced Christopher Dodd, Jim
    Sullivan and Diane Farrell and there was no express advocacy.  We have moved this
    expenditure to line 30.  Q5. Please note that due to the unanticipated volume
    of financial transactions during the period, the Committee inadvertently failed
    to disclose a disbursement of $9.95 from a bank fee in the period.  The Committee
    intends to adjust its workforce in future elections so that it is better prepared
    to handle the volume of activity to ensure full and timely disclosure of financial
    activity to the FEC."'
